import React from "react";
import './App.css';

const Nav = () => {
    return (
        <nav>
          <img src={logo}></img>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
          <Link to="/expenses">Expenses</Link>
        </nav>
    );
};

export default Nav;
